void OAIDefaultApi::gETRestoreDBClusterToPointInTimeCallback(OAIHttpRequestWorker *worker) {
    QString error_str = worker->error_str;
    QNetworkReply::NetworkError error_type = worker->error_type;

    if (worker->error_type != QNetworkReply::NoError) {
        error_str = QString("%1, %2").arg(worker->error_str, QString(worker->response));
    }
    OAIRestoreDBClusterToPointInTimeResult output(QString(worker->response));
    worker->deleteLater();

    if (worker->error_type == QNetworkReply::NoError) {
        Q_EMIT gETRestoreDBClusterToPointInTimeSignal(output);
        Q_EMIT gETRestoreDBClusterToPointInTimeSignalFull(worker, output);
    } else {

#if defined(_MSC_VER)
// For MSVC
#pragma warning(push)
#pragma warning(disable : 4996)
#elif defined(__clang__)
// For Clang
#pragma clang diagnostic push
#pragma clang diagnostic ignored "-Wdeprecated-declarations"
#elif defined(__GNUC__)
// For GCC
#pragma GCC diagnostic push
#pragma GCC diagnostic ignored "-Wdeprecated-declarations"
#endif

        Q_EMIT gETRestoreDBClusterToPointInTimeSignalE(output, error_type, error_str);
        Q_EMIT gETRestoreDBClusterToPointInTimeSignalEFull(worker, error_type, error_str);

#if defined(_MSC_VER)
#pragma warning(pop)
#elif defined(__clang__)
#pragma clang diagnostic pop
#elif defined(__GNUC__)
#pragma GCC diagnostic pop
#endif

        Q_EMIT gETRestoreDBClusterToPointInTimeSignalError(output, error_type, error_str);
        Q_EMIT gETRestoreDBClusterToPointInTimeSignalErrorFull(worker, error_type, error_str);
    }
}

